import React from 'react';
import MainPages from './components/MainPages'
import NavBar from './components/Features/NavBar/NavBar.js'

class App extends React.Component {
    render() {
        return (
            <div>
                <NavBar />
                <MainPages /> </div>
        )
    }
}



export default App;
